import React from "react";

export const LeadTime = ({task}) => {
    return (
        <div>
            {task.completedTask ? Object.values(task.completedTask).map(completedTask => {
                return (
                    <div>
                        <div>{completedTask.completedTaskDay}</div>
                        <div>{completedTask.completedTaskTime}</div>
                    </div>
                )

            }) : null}
        </div>
    )
}
